import React from "react";
const SignUp = ()=>{
    return(
        <>
            <h1>Register</h1>
            <input type="text" placeholder="Enter name"/>
            <input type="text" placeholder="Enter email"/>
            <input type="password" placeholder="Enter Password"/>

        </>
    )
}

export default SignUp;
